REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('415', 'en_US', 'email:appuserActivate', '<h3>Hello!</h3>\r\n<p>your recent requests for verification.If you want to complete this process, please enter the verification code below on the validation page.</p>\r\n<p>your verification code is:</p>\r\n<p>${activateCode}</p>\r\n<p>if you did not put forward this request, may be have an unauthorized user is trying to operate your account, you need to verify account information user platform.</p>\r\n<h3>Best Regards! </h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:30:49', NULL, '2018-08-27 07:30:49', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('416', 'zh_CN', 'email:appuserActivate', '<h3>您好!</h3>\r\n<p>您最近提出获取验证请求。若要完成此流程，请在验证页面输入下方验证码。</p>\r\n<p>您的验证码是：</p>\r\n<p>${activateCode}</p>\r\n<p>如果您没有提出此请求，则可能是有未经授权的用户正在试图操作您的账号，你需要用户平台验证账号信息。</p>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:30:54', NULL, '2018-08-27 07:30:54', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('417', 'en_US', 'email:adminResetPassword', '<h3>Hello!</h3>\r\n<p>your recent request to reset the account password.Password reset has been finished, please use the new password promptly change the password after login.</p>\r\n<p>the new password of your account is: </p>\r\n<p>${newPassword}</p>\r\n<p>if you did not put forward this request, may be have an unauthorized user is trying to access your account, you need to go to the administrator platform to verify account information.</p>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:30:54', NULL, '2018-08-27 07:30:54', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('418', 'zh_CN', 'email:adminResetPassword', '<h3>您好!</h3>\r\n<p>您最近提出重置账号密码的请求。密码已重置完成，请使用新密码登录后及时修改密码。</p>\r\n<p>您账号的新密码是：</p>\r\n<p>${newPassword}</p>\r\n<p>如果您没有提出此请求，则可能是有未经授权的用户正在试图访问您的账号，你需要前往管理员平台验证账号信息。</p>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:30:54', NULL, '2018-08-27 07:30:54', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('419', 'en_US', 'email:appuserShare', '<h3>Hello!</h3>\r\n<p>   ${appUserNickName}the request to you, invite you to join the ${appUserNickName} member of the family.</p>\r\n<span>if you agree to invite, please after receipt of the email within 15 minutes by clicking the link below:</span>\r\n<a href=${shareInfo}>${shareInfo}</a>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:38:58', NULL, '2018-08-27 07:38:58', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('420', 'zh_CN', 'email:appuserShare', '<h3>您好!</h3>\r\n<p>   ${appUserNickName}向你发出请求，邀请您加入${appUserNickName}的家庭成员。</p>\r\n<span>若您同意邀请，请在收到邮件15分钟内点下面的连接：</span>\r\n<a href=${shareInfo}>${shareInfo}</a>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:39:07', NULL, '2018-08-27 07:39:07', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('421', 'en_US', 'email:comedueplanComedueRemind', '<h3>Hello!</h3>\r\n<p>video recording plan name: ${planName}</p>\r\n<p>plan validity:${planStartTime}-${planEndTime}</p>\r\n<p>plan to binding equipment:${deviceName}</p>\r\n<p>plan details:${packageName}</p>\r\n<p>renew connections: </p>\r\n<a href=${renewalConcat}>${renewalConcat}</a>\r\n<p>note: please note that if the plan within 5 days after due for renewal, still we will close the recording plan, when all of your videos stored data will be cleared</p>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:33:43', NULL, '2018-08-27 07:33:43', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('422', 'zh_CN', 'email:comedueplanComedueRemind', '<h3>您好!</h3>\r\n<p>录影计划名称：${planName}</p>\r\n<p>计划有效期：${planStartTime}-${planEndTime}</p>\r\n<p>计划绑定设备：${deviceName}</p>\r\n<p>计划详情：${packageName}</p>\r\n<p>续费连接：</p>\r\n<a href=${renewalConcat}>${renewalConcat}</a>\r\n<p>注意事项：请注意若计划在到期后5天内仍为续费，我们会关闭这个计划，届时您的所有录影存储资料会被清空</p>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:33:43', NULL, '2018-08-27 07:33:43', 'valid');
