REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('429', 'en_US', 'email:payrefundAudit', '<h3>hello!</h3>\r\n<p>   at the request of the user, administrator ${adminName} to the order ${orderId} to apply for a refund, refund reason for users is: ${refundReason}.</p>\r\n<p>the order a refund amount is:${paidPrice}</p>\r\n<p>the order a refund amount is:${refundSum}</p>\r\n<p>please click on the link below to view the order details, and as soon as possible to deal with the order of the refund application.</p>\r\n<a href=${orderLink}>${orderLink}</a>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('430', 'zh_CN', 'email:payrefundAudit', '<h3>各位领导，您好：</h3>\r\n<p>   应用户要求，管理员${adminName}代为将订单${orderId}申请退款，用户的退款原因是：${refundReason}。</p>\r\n<p>订单付款金额为：${paidPrice}</p>\r\n<p>订单退款金额为：${refundSum}</p>\r\n<p>请点击下面的链接查看订单详情，并尽快处理该订单的退款申请</p>\r\n<a href=${orderLink}>${orderLink}</a>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('431', 'en_US', 'email:resetPassword', '<h3>Hello!</h3>\r\n<p>your recent request to reset the account password.Password reset has been finished, please use the new password promptly change the password after login.</p>\r\n<p>the new password of your account is:</p>\r\n<p>${newPassword}</p>\r\n<p>if you did not put forward this request, may be have an unauthorized user is trying to access your account, you need to verify account information user platform.</p>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
