REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('433', 'en_US', 'email:shareDevice', '<h3>Hello!</h3>\r\n<p>   ${userName} device share requests to you, if you agree to share, please accept device share page enter the confirmation code below.</p>\r\n<p>your share confirmation code is:</p>\r\n<p>${confirmCode}</p>\r\n<p>share the detailed information is as follows:</p>\r\n<p>${shareInfo}</p>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('434', 'zh_CN', 'email:shareDevice', '<h3>您好!</h3>\r\n<p>   ${userName}向你发出设备分享请求,若您同意分享，请在接受设备分享页面输入下方的确认码。</p>\r\n<p>您的分享确认码是：</p>\r\n<p>${confirmCode}</p>\r\n<p>本次分享的详细信息如下：</p>\r\n<p>${shareInfo}</p>\r\n<h3>此致!</h3><br>\r\n<h3>软件平台部  支持</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('435', 'en_US', 'email:userWarningProcessingSchedule', '<h3>Hello!</h3>\r\n<p>click the link login can query the people with disabilities order handling process recently.</p>\r\n<p>reported barrier single number:</p>\r\n<p>${warningNum}</p>\r\n<p>login link:</p>\r\n<p>${videoAdminLoginAddress}</p>\r\n<h3>Best Regards!</h3><br>\r\n<h3>Leedarson platform Team</h3>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
REPLACE INTO `iot_db_system`.`lang_info` (`id`, `lang_type`, `lang_key`, `lang_value`, `create_by`, `create_time`, `update_by`, `update_time`, `is_deleted`) VALUES ('436', 'zh_CN', 'email:userWarningProcessingSchedule', '<h3>您好!</h3>\r\n<p>点击链接登录可以查询该报障单号的最近处理流程。</p>\r\n<p>报障单号：</p>\r\n<p>${warningNum}</p>\r\n<p>登录链接地址：</p>\r\n<p>${videoAdminLoginAddress}</p>', '11003408', '2018-08-27 07:42:06', NULL, '2018-08-27 07:42:06', 'valid');
